create table #t(CountryId INT, CurrencyName nvarchar(255), CurrencyDigitalCode nvarchar(5), CurrencyAbbreviation nvarchar(255), CurrencySymbol nvarchar(255))
GO

GO
GO

UPDATE c
SET c.CurrencyName=t.CurrencyName,
	c.CurrencyDigitalCode=t.CurrencyDigitalCode,
	c.CurrencyAbbreviation=t.CurrencyAbbreviation,
	c.CurrencySymbol=t.CurrencySymbol
from LuCountry c INNER join #t t
ON c.CountryId=t.CountryId

